import React, { useState } from "react";

const SignUpForm = () => {
  const [focus, setFocus] = useState({
    name: false,
    username: false,
    password: false,
    confirmPassword: false,
    email: false,
  });

  const [showPassword, setShowPassword] = useState(false);
  const [showConfirmPassword, setShowConfirmPassword] = useState(false);
  const [usernameTaken, setUsernameTaken] = useState(""); // Error message for taken username
  const [passwordError, setPasswordError] = useState("");
  const [emailError, setEmailError] = useState("");
  const [email, setEmail] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [loading, setLoading] = useState(false);

  // Password validation
  const validatePassword = (password) => {
    if (password.length < 6) {
      setPasswordError("Password must be at least 6 characters long.");
    } else {
      setPasswordError("");
    }
  };

  // Email validation
  const validateEmail = (email) => {
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    if (!emailRegex.test(email)) {
      setEmailError("Invalid email format.");
    } else {
      setEmailError("");
    }
  };

  // Handle input focus
  const handleFocus = (field) => setFocus((prev) => ({ ...prev, [field]: true }));

  // Handle input blur
  const handleBlur = (field, value) => {
    if (!value) setFocus((prev) => ({ ...prev, [field]: false }));
    if (field === "password") {
      validatePassword(value);
    }
    if (field === "email") {
      validateEmail(value);
    }
  };

  // Handle confirm password change
  const handleConfirmPasswordChange = (e) => {
    setConfirmPassword(e.target.value);
    if (e.target.value !== password) {
      setPasswordError("Passwords do not match");
    } else {
      setPasswordError("");
    }
  };
  const handleSubmit = (e) => {
    e.preventDefault();
    
    if (!email || !username || !password || !confirmPassword) {
      alert("Please fill in all fields");
      return;
    }
  
    if (password !== confirmPassword) {
      setPasswordError("Passwords do not match");
      return;
    }
  
    setLoading(true);
    
    // Make an API call to register the user
    fetch('http://localhost:5000/api/signup', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        fullName: email, // Assuming full name and email are the same in your current form
        username,
        email,
        password,
        confirmPassword,
      }),
    })
      .then((response) => response.json())
      .then((data) => {
        setLoading(false);
        if (data.message) {
          alert(data.message);
        }
      })
      .catch((error) => {
        setLoading(false);
        console.error("Error:", error);
      });
  };
  const checkUsernameAvailability = (username) => {
    if (!username) return;
  
    // Make an API call to check username availability
    fetch(`http://localhost:5000/api/check-username?username=${username}`)
      .then((response) => response.json())
      .then((data) => {
        if (data.isTaken) {
          setUsernameTaken("Username is already taken");
        } else {
          setUsernameTaken("");
        }
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };
  
  

  return (
    <div style={styles.container}>
  <div style={styles.innerContainer}>
    <div style={styles.formWrapper}>
      <form onSubmit={handleSubmit}>
        <h2 style={styles.heading}>CUISINING</h2>

        {/* Name Field */}
        <div style={styles.inputWrapper}>
          <label style={styles.inputLabel(focus.name)}>Name</label>
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            style={styles.inputField(focus.name)}
            onFocus={() => handleFocus("name")}
            onBlur={(e) => handleBlur("name", e.target.value)}
          />
          {errors.name && <div style={styles.errorText}>{errors.name}</div>}
        </div>

        {/* Email Field */}
        <div style={styles.inputWrapper}>
          <label style={styles.inputLabel(focus.email)}>Email</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            style={styles.inputField(focus.email)}
            onFocus={() => handleFocus("email")}
            onBlur={(e) => handleBlur("email", e.target.value)}
          />
          {errors.email && <div style={styles.errorText}>{errors.email}</div>}
        </div>

        {/* Username Field */}
        <div style={styles.inputWrapper}>
          <label style={styles.inputLabel(focus.username)}>Username</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            style={styles.inputField(focus.username)}
            onFocus={() => handleFocus("username")}
            onBlur={(e) => {
              handleBlur("username", e.target.value);
              checkUsernameAvailability(e.target.value);
            }}
          />
          {usernameTaken && <div style={styles.errorText}>{usernameTaken}</div>}
        </div>

        {/* Password Field */}
        <div style={styles.inputWrapper}>
          <label style={styles.inputLabel(focus.password)}>Password</label>
          <input
            type={passwordVisible ? "text" : "password"}
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            style={styles.inputField(focus.password)}
            onFocus={() => handleFocus("password")}
            onBlur={(e) => handleBlur("password", e.target.value)}
          />
          <button
            type="button"
            onClick={() => setPasswordVisible(!passwordVisible)}
            style={styles.togglePassword}
          >
            {passwordVisible ? "Hide" : "Show"}
          </button>
          {errors.password && <div style={styles.errorText}>{errors.password}</div>}
        </div>

        {/* Submit Button */}
        <div style={{ marginTop: "20px", display: "flex", justifyContent: "center" }}>
          <button
            type="submit"
            disabled={loading}
            style={{
              ...styles.submitButton,
              ...(loading && { backgroundColor: "#A9A35A" }),
            }}
          >
            {loading ? "Loading..." : "Sign Up"}
          </button>
        </div>

        {/* Social Media Icons */}
        <div style={styles.socialWrapper}>
          <a href="#" style={{ marginRight: "10px" }}>
            <img src="facebook.png" alt="Facebook Login" style={styles.socialIcon} />
          </a>
          <a href="#">
            <img src="google.png" alt="Google Login" style={styles.socialIcon} />
          </a>
        </div>

        {/* Footer */}
        <div style={styles.footerText}>
          Already Have an Account?{" "}
          <a href="/" style={styles.link}>
            Log In
          </a>
        </div>
      </form>
    </div>
  </div>
</div>

  );
};
const styles = {
  container: {
    backgroundImage: "url('lbg.png')",
    backgroundSize: "cover",
    backgroundPosition: "center",
    backgroundAttachment: "fixed",
    height: "100%",
    width: "100%",
  },
  innerContainer: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    padding: "20px",
    minHeight: "100vh",
  },
  formWrapper: {
    background: "rgba(255, 255, 255, 0.7)",
    backdropFilter: "blur(10px)",
    WebkitBackdropFilter: "blur(0px)",
    borderRadius: "10px",
    padding: "25px",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
    width: "100%",
    maxWidth: "400px",
  },
  heading: {
    textAlign: "center",
    color: "#363100",
    fontSize: "2rem",
    marginBottom: "20px",
  },
  inputWrapper: {
    position: "relative",
    marginBottom: "20px",
  },
  inputLabel: (focus) => ({
    position: "absolute",
    left: "10px",
    top: focus ? "-10px" : "50%",
    fontSize: focus ? "12px" : "16px",
    color: "#363100",
    transition: "all 0.3s ease",
    transform: focus ? "translateY(0)" : "translateY(-50%)",
    padding: "0 5px",
  }),
  inputField: (focus) => ({
    width: "100%",
    padding: "10px",
    border: "1px solid transparent",
    borderRadius: "10px",
    outline: "none",
    backgroundColor: "#f8f8f8",
    transition: "all 0.3s ease",
    ...(focus && {
      border: "1px solid #C1B857",
      boxShadow: "0 0 8px rgba(193, 184, 87, 0.5)",
      backgroundColor: "#fff",
    }),
  }),
  togglePassword: {
    position: "absolute",
    right: "10px",
    top: "50%",
    transform: "translateY(-50%)",
    background: "transparent",
    border: "none",
    cursor: "pointer",
  },
  errorText: {
    color: "red",
    fontSize: "12px",
    marginTop: "5px",
  },
  submitButton: {
    padding: "10px 20px",
    backgroundColor: "#C1B857",
    color: "#fff",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    fontSize: "16px",
    transition: "background-color 0.3s ease",
  },
  socialWrapper: {
    display: "flex",
    justifyContent: "center",
    marginBottom: "20px",
  },
  socialIcon: {
    width: "40px",
    height: "40px",
    marginRight: "10px",
  },
  footerText: {
    textAlign: "center",
    fontSize: "14px",
    marginTop: "20px",
  },
  link: {
    color: "#C1B857",
  },
};

export default SignUpForm;
